webpackJsonp([0xba2b595d14c35000],{"./node_modules/json-loader/index.js!./.cache/json/sql-sql-inner-join-keyword.json":function(n,e){n.exports={data:{markdownRemark:{html:'<h2>SQL Inner Join Keyword</h2>\n<h3>Example of use</h3>\n<p>For this guide we’ll discuss the SQL (INNER) Joins </p>\n<h3>Join (same as Inner Join)</h3>\n<p>The student table will be in the FROM clause so it will be a starting or LEFT table.</p>\n<p>We’ll JOIN this to the student contact table or RIGHT table.\nYou’ll see that all of the students appear that ALSO are in the contact table.  As shown in the tables below, studentID 9 is in the student table but NOT in the contact table so won’t appear in a join.</p>\n<p>SQL Statement</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>FullName<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>programOfStudy<span class="token punctuation">,</span>\n<span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>phone<span class="token operator">-</span>cell<span class="token punctuation">`</span><span class="token punctuation">,</span> <span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>US<span class="token operator">-</span>zipcode<span class="token punctuation">`</span>\n<span class="token keyword">FROM</span> student <span class="token keyword">AS</span> <span class="token number">a</span>\n<span class="token keyword">INNER</span> <span class="token keyword">JOIN</span> <span class="token punctuation">`</span>student<span class="token operator">-</span>contact<span class="token operator">-</span>info<span class="token punctuation">`</span> <span class="token keyword">AS</span> <span class="token number">b</span> <span class="token keyword">ON</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID <span class="token operator">=</span> <span class="token number">b</span><span class="token punctuation">.</span>studentID<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>“Joined” data</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+------------------------+------------------+--------------------+--------------------+\n| studentID | FullName               | programOfStudy   | student-phone-cell | student-US-zipcode |\n+-----------+------------------------+------------------+--------------------+--------------------+\n|         1 | Monique Davis          | Literature       | 555-555-5551       |              97111 |\n|         2 | Teri Gutierrez         | Programming      | 555-555-5552       |              97112 |\n|         3 | Spencer Pautier        | Programming      | 555-555-5553       |              97113 |\n|         4 | Louis Ramsey           | Programming      | 555-555-5554       |              97114 |\n|         5 | Alvin Greene           | Programming      | 555-555-5555       |              97115 |\n|         6 | Sophie Freeman         | Programming      | 555-555-5556       |              97116 |\n|         7 | Edgar Frank "Ted" Codd | Computer Science | 555-555-5557       |              97117 |\n|         8 | Donald D. Chamberlin   | Computer Science | 555-555-5558       |              97118 |\n+-----------+------------------------+------------------+--------------------+--------------------+</code></pre>\n      </div>\n<h3>Complete table listings for reference</h3>\n<p>Student table SQL</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>FullName<span class="token punctuation">,</span> sat_score<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>programOfStudy<span class="token punctuation">,</span> schoolEmailAdr \n<span class="token keyword">FROM</span> student <span class="token keyword">AS</span> <span class="token number">a</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>student or LEFT table</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+------------------------+-----------+------------------+------------------------+\n| studentID | FullName               | sat_score | programOfStudy   | schoolEmailAdr         |\n+-----------+------------------------+-----------+------------------+------------------------+\n|         1 | Monique Davis          |       400 | Literature       | Monique@someSchool.edu |\n|         2 | Teri Gutierrez         |       800 | Programming      | Teri@someSchool.edu    |\n|         3 | Spencer Pautier        |      1000 | Programming      | Spencer@someSchool.edu |\n|         4 | Louis Ramsey           |      1200 | Programming      | Louis@someSchool.edu   |\n|         5 | Alvin Greene           |      1200 | Programming      | Alvin@someSchool.edu   |\n|         6 | Sophie Freeman         |      1200 | Programming      | Sophie@someSchool.edu  |\n|         7 | Edgar Frank "Ted" Codd |      2400 | Computer Science | Edgar@someSchool.edu   |\n|         8 | Donald D. Chamberlin   |      2400 | Computer Science | Donald@someSchool.edu  |\n|         9 | Raymond F. Boyce       |      2400 | Computer Science | Raymond@someSchool.edu |\n+-----------+------------------------+-----------+------------------+------------------------+\n9 rows in set (0.00 sec)\n\n\n```sql\nSELECT * FROM `student-contact-info` AS b;</code></pre>\n      </div>\n<p>student contact table or RIGHT table</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+----------------------------------+--------------------+--------------------+\n| studentID | studentEmailAddr                 | student-phone-cell | student-US-zipcode |\n+-----------+----------------------------------+--------------------+--------------------+\n|         1 | Monique.Davis@freeCodeCamp.org   | 555-555-5551       |              97111 |\n|         2 | Teri.Gutierrez@freeCodeCamp.org  | 555-555-5552       |              97112 |\n|         3 | Spencer.Pautier@freeCodeCamp.org | 555-555-5553       |              97113 |\n|         4 | Louis.Ramsey@freeCodeCamp.org    | 555-555-5554       |              97114 |\n|         5 | Alvin.Green@freeCodeCamp.org     | 555-555-5555       |              97115 |\n|         6 | Sophie.Freeman@freeCodeCamp.org  | 555-555-5556       |              97116 |\n|         7 | Maximo.Smith@freeCodeCamp.org    | 555-555-5557       |              97117 |\n|         8 | Michael.Roach@freeCodeCamp.ort   | 555-555-5558       |              97118 |\n+-----------+----------------------------------+--------------------+--------------------+\n8 rows in set (0.00 sec)</code></pre>\n      </div>\n<h3>Conclusion</h3>\n<p>As with all of these SQL things there is MUCH MORE to them than what’s in this introductory guide.  </p>\n<p>I hope this at least gives you enough to get started.  </p>\n<p>Please see the manual for your database manager and have fun trying different options yourself.</p>',fields:{slug:"/sql/sql-inner-join-keyword/"},frontmatter:{title:"SQL Inner Join Keyword"}}},pathContext:{slug:"/sql/sql-inner-join-keyword/"}}}});
